import React from 'react';
import { Navbar, Nav, NavDropdown, Form, FormControl, Button } from 'react-bootstrap'
const custom_style = { backgroundColor: "#197ff2", marginLeft:"0px", padding:"13px"};
const custom_style_1 = { backgroundColor: "#ffffff", marginLeft:"30px" };

function NavbarSearchComponent(props) {
    return (
        <div>
            <Navbar style={custom_style} expand="lg">
                <Navbar.Toggle aria-controls="navbarScroll" />
                <Navbar.Collapse id="navbarScroll">
                   
                    
                        
                </Navbar.Collapse>
            </Navbar>
        </div >
    )
}

export default NavbarSearchComponent;
